# frozen_string_literal: true
require 'set'

def length_of_longest_substring(s)
  return 0 if s == ""

  max = 0
  max_so_far = 0
  chars = s.split(//)
  length = s.length - 1
  current_index = 0
  characters_first_found = {}

  loop do
    char = chars[current_index]
    # puts "CHAR: #{char}"
    if characters_first_found[char]
      # p 'DUP CHAR', max_so_far
      max = max_so_far if max_so_far > max
      max_so_far = 0
      current_index = characters_first_found[char] + 1
      characters_first_found.clear
      next
    else
      # p 'NON-DUP'
      characters_first_found[char] = current_index
      max_so_far += 1
    end

    break if current_index == length
    current_index += 1
  end

  [max, max_so_far].max
end

